import React, { useState, useMemo } from 'react';
import MobilePicker from 'react-mobile-picker';
import './DemographicPage.css';

function DemographicPage({ onBack, onNext }) {
  // Age options with a placeholder option
  const ageOptions = useMemo(() => {
    const arr = ['--'];
    for (let i = 6; i <= 100; i++) {
      arr.push(i.toString());
    }
    return arr;
  }, []);

  // Height options for metric (cm)
  const cmOptions = useMemo(() => {
    const arr = ['--'];
    for (let i = 90; i <= 220; i++) {
      arr.push(i.toString());
    }
    return arr;
  }, []);

  // Height options for imperial: feet and inches
  const feetOptions = useMemo(() => ['--', '3', '4', '5', '6', '7'], []);
  const inchOptions = useMemo(() => {
    const arr = ['--'];
    for (let i = 0; i < 12; i++) {
      arr.push(i.toString());
    }
    return arr;
  }, []);

  // Weight options for kg and lb
  const kgOptions = useMemo(() => {
    const arr = ['--'];
    for (let i = 20; i <= 200; i++) {
      arr.push(i.toString());
    }
    return arr;
  }, []);
  const lbOptions = useMemo(() => {
    const arr = ['--'];
    for (let i = 45; i <= 440; i++) {
      arr.push(i.toString());
    }
    return arr;
  }, []);

  // State for each picker value; default is placeholder '--'
  const [age, setAge] = useState('--');
  const [heightUnit, setHeightUnit] = useState('cm'); // 'cm' or 'feet'
  const [height, setHeight] = useState('--'); // if metric
  const [feet, setFeet] = useState('--');     // if imperial
  const [inches, setInches] = useState('--');   // if imperial
  const [weightUnit, setWeightUnit] = useState('kg'); // 'kg' or 'lb'
  const [weight, setWeight] = useState('--');

  // Handlers for MobilePicker (note: MobilePicker passes (name, value))
  const handleAgeChange = (name, value) => setAge(value);
  const handleHeightChange = (name, value) => setHeight(value);
  const handleFeetChange = (name, value) => setFeet(value);
  const handleInchesChange = (name, value) => setInches(value);
  const handleWeightChange = (name, value) => setWeight(value);

  const handleSubmit = () => {
    // Process age
    const finalAge = age === '--' ? undefined : parseInt(age, 10);
    // Process height
    let finalHeight = undefined;
    if (heightUnit === 'cm') {
      finalHeight = height === '--' ? undefined : parseInt(height, 10);
    } else {
      const ft = feet === '--' ? 0 : parseInt(feet, 10);
      const in_ = inches === '--' ? 0 : parseInt(inches, 10);
      finalHeight = Math.round((ft * 12 + in_) * 2.54);
    }
    // Process weight
    const finalWeight = weight === '--' ? undefined : parseInt(weight, 10);
    
    console.log({
      age: finalAge,
      height: finalHeight,
      weight: finalWeight,
      heightUnit,
      weightUnit
    });
    onNext();
  };

  return (
    <div className="demographic-page">
      <div className="demographic-header">
        <button className="back-button" onClick={onBack}>Back</button>
        <div className="demographic-logo" onClick={onBack}>MasidtAI</div>
      </div>

      <h2>Demographic Survey</h2>
      <div className="picker-container">
        {/* Age Picker */}
        <div className="picker-section">
          <h3>Age</h3>
          <MobilePicker
            optionGroups={{ age: ageOptions }}
            valueGroups={{ age }}
            onChange={handleAgeChange}
          />
          <p className="picker-note">Scroll to select your age</p>
        </div>

        {/* Height Picker */}
        <div className="picker-section">
          <h3>Height</h3>
          <div className="unit-toggle">
            <label>
              <input
                type="radio"
                name="heightUnit"
                value="cm"
                checked={heightUnit === 'cm'}
                onChange={() => {
                  setHeightUnit('cm');
                  setHeight('--');
                }}
              />
              cm
            </label>
            <label>
              <input
                type="radio"
                name="heightUnit"
                value="feet"
                checked={heightUnit === 'feet'}
                onChange={() => {
                  setHeightUnit('feet');
                  setFeet('--');
                  setInches('--');
                }}
              />
              ft/in
            </label>
          </div>
          {heightUnit === 'cm' ? (
            <div>
              <MobilePicker
                optionGroups={{ height: cmOptions }}
                valueGroups={{ height }}
                onChange={handleHeightChange}
              />
              <span className="unit-label">cm</span>
            </div>
          ) : (
            <div className="dual-picker">
              <MobilePicker
                optionGroups={{ feet: feetOptions }}
                valueGroups={{ feet }}
                onChange={handleFeetChange}
              />
              <span className="unit-label">ft</span>
              <MobilePicker
                optionGroups={{ inches: inchOptions }}
                valueGroups={{ inches }}
                onChange={handleInchesChange}
              />
              <span className="unit-label">in</span>
            </div>
          )}
          <p className="picker-note">Scroll to select your height</p>
        </div>

        {/* Weight Picker */}
        <div className="picker-section">
          <h3>Weight</h3>
          <div className="unit-toggle">
            <label>
              <input
                type="radio"
                name="weightUnit"
                value="kg"
                checked={weightUnit === 'kg'}
                onChange={() => {
                  setWeightUnit('kg');
                  setWeight('--');
                }}
              />
              kg
            </label>
            <label>
              <input
                type="radio"
                name="weightUnit"
                value="lb"
                checked={weightUnit === 'lb'}
                onChange={() => {
                  setWeightUnit('lb');
                  setWeight('--');
                }}
              />
              lb
            </label>
          </div>
          <MobilePicker
            optionGroups={{ weight: weightUnit === 'kg' ? kgOptions : lbOptions }}
            valueGroups={{ weight }}
            onChange={handleWeightChange}
          />
          <span className="unit-label">{weightUnit}</span>
          <p className="picker-note">Scroll to select your weight</p>
        </div>
      </div>

      <div className="demographic-footer">
        <button className="submit-button" onClick={handleSubmit}>Next</button>
      </div>
    </div>
  );
}

export default DemographicPage;
